import React from 'react';
import './ExpensesList.css';
import ExpenseItem from './ExpenseItem';

let expensesContent = <p className="error">No expenses found</p> // default value

if (props.items.length > 0){
    expensesContent = ( // override the default if there's content in the list
        expenseList.map((expense) =>   
            <ExpenseItem
                key={expense.id}
                title={expense.title}
                price={expense.price}
                date={expense.date} 
            />
    ));
}

const ExpensesList = (props) => {
    return(
        {expensesContent}
    )
}

export default ExpensesList;
